function checkIfFinishedLoading() {
    let deaths = 0;
    for (let i = 0; i < sketches.length; i++) {
        if (sketches[i].brain.alive == false) {
            deaths++;
        }
    }
    if (deaths == sketches.length) {
        let averageScore = 0;
        for (let i = 0; i < sketches.length; i++) {
            averageScore += sketches[i].brain.snakeScore;
        }

        snakeIsLoading = false;
        averageScore = (averageScore * 1.0 / sketches.length).toFixed(2);
        document.getElementById("averageScoreID").innerHTML = averageScore;
    }
}

function initializeLoading(genesToLoad) {
    var sliderPopulationSize = document.getElementById('populationSize');

    if (sketches.length != 0) {
        let averageScore = 0;
        for (var i = 0; i < sketches.length; i++) {
            averageScore += sketches[i].brain.snakeScore;
            window.clearInterval(sketches[i].brain.intervalID);
            sketches[i].remove();
        }
        averageScore = (averageScore * 1.0 / sketches.length).toFixed(2);
        document.getElementById("averageScoreID").innerHTML = averageScore;
        if (trainingStarted) {
            trainingStarted = false;
            document.getElementById('TrainingButton').innerText = 'Start Training';
        }
    }
    population = undefined;
    sketches = [];

    for (let i = 0; i < sliderPopulationSize.value; i++) {
        sketches.push(new p5(fct, 'firstSpan1'));
        if (powerups) {
            sketches[i].brain = new Snake(11);
        } else {
            sketches[i].brain = new Snake(6);
        }
        sketches[i].brain.loadGenes(genesToLoad);
        sketches[i].brain.id = i;
    }
    snakeIsLoading = true;
}

function loadSnakeFromNeuralNetwork() {
    var option = document.getElementById('snakesFromNeuralNetwork');
    var genesToLoad;

    switch (option.options[option.selectedIndex].value) {
        case 'Allrounder18':
            genesToLoad = Allrounder18;
            break;
        case 'BellyRubber24':
            genesToLoad = BellyRubber24;
            break;
        case 'Brutus10':
            genesToLoad = Brutus10;
            break;
        case 'Brutus11':
            genesToLoad = Brutus11;
            break;
        case 'Brutus30':
            genesToLoad = Brutus30;
            break;
        case 'Spiderman37':
            genesToLoad = Spiderman37;
            break;
        case 'Spiderman46':
            genesToLoad = Spiderman46;
            break;
        case 'Spiderman48':
            genesToLoad = Spiderman48;
            break;
        case 'Spiderman49':
            genesToLoad = Spiderman49;
            break;
    }

    initializeLoading(genesToLoad);

    /* makes sure only 1 test per second */
    clearInterval(interval);

    interval = setInterval(checkIfFinishedLoading, 1000);
}

